import styled from "styled-components";

export const Content = styled.div`
    display: flex;
`;

export const BlockRight = styled.div`
width: 30%;
`;

export const BlockLeft = styled.div`
    width: 70%;
    .flex{
        display: flex;

        div{
            width: 33.333%;
            &.image{
                display: block;
                text-align: center;
                background: #e5e5e5;
                padding: 7% 0;
                margin-bottom: 20px;
            }
        }
    }
`;
